  of New Zealand shortly afterwards). James served in the Royal Navy until 1928 and advanced to
  the rank of Admiral. He served in the Boxer Rising in China, and was a lieutenant in charge of
  one of Grant's guns being trekked across South Africa to the relief of Ladysmith in the South
  African War (the origin of the modern day field gun competition in the Royal Tournament in the
  UK. In WW1 he commanded HMS Thunderer in the Battle of Jutland in 1916 and he was Commander in Chief of the
  North America and West Indies Station in 1924-26. He was awarded the KCB and KCMG.
